import React,{useState} from 'react'
import axios from 'axios'
function Main()
{
    const [nam,useNam]=useState("")

   
        const cdoc=async(e)=>{
            e.preventDefault()
            try{

                await axios.post("http://localhost:8888/sign",{nam})
            }
            catch(err)
            {
                console.log(err)
            }


        }
 
        return(<>
        
        <input type='name' name="nam" onChange={(e)=>useNam(e.target.value)}/>
        <button type='submit' onSubmit={cdoc()}>button</button>
        </>)
}
export default Main
